import React, { Component } from "react";

export class NewsItem extends Component {
  render() {
    let [title,description]=this.props;
    return (
      <div>
        <div   classame="card" style="width: 18rem;">
          <img   classame="card-img-top" src="..." alt="Card image cap" />
          <div   classame="card-body">
            <h5   classame="card-title">{title}</h5>
            <p   classame="card-text">
              {description}
            </p>
            <a href="#"   classame="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default NewsItem;
